        print('Error: n should be greater than 1.')
        return
    is_prime = [True] * n
    is_prime[0] = False
    for i in range(2, int(n ** 0.5) + 1):
        if is_prime[i - 1]:
            for j in range(i * i, n, i):
                is_prime[j + 1] = False
    primes = [i + 1 for i in range(n - 1) if is_prime[i]]
    return primes

